import React from 'react';
import { DataProvider } from '../DataProvider';

const UserOpenOrder = () => {
  return (
    <DataProvider>
      <div className="header-container">
        <div className="user">
          <h1>Hi Lars</h1>
          <span>10 task pending</span>
        </div>
        <div className="user-image">
          <img
            src="http://radiotape.de/wp-content/uploads/2015/12/Lars.png"
            alt="Lars"
          />
        </div>
      </div>
    </DataProvider>
  );
};

export default UserOpenOrder;
